import React from "react";

class Header extends React.Component {

    render() {
        return (
            <>
                <header className="top">
                    <h1>
                        Catch
                        <span className="ofThe">
                            <span className="of">Of</span>
                            <span className="the">The</span>
                        </span>
                        Day
                    </h1>
                </header>
                <h3 className="tagline">
                    Fresh Daily!
                </h3>
            </>
        );
    }
}

export default Header;
